import './App.css';
import ListPeliculas from './components/ListPeliculas';
import ListUsers from './components/ListUsers';

import { Link, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
      <Link to="/api/users">Lista de Usuarios</Link><br></br>
      <Link to="/api/products">Lista de Peliculas</Link>
      <hr></hr>
      <Routes>
        <Route path="/api/users" element={ListUsers} />
        <Route path="/api/products" element={<ListPeliculas />} />
      </Routes>
    </>
  );
}

export default App;
